import { Component, Input } from '@angular/core';
import { dataCenter } from '../data';
import { Router } from '@angular/router';
import { DomSanitizer, SafeResourceUrl } from '@angular/platform-browser'

@Component({
  selector: 'app-custom-note-landing',
  templateUrl: './custom-note-landing.component.html',
  styleUrl: './custom-note-landing.component.scss'
})
export class CustomNoteLandingComponent {
  customNoteData = []; 
  @Input() showActionButton:boolean = true;

  constructor(public sanitizer: DomSanitizer, private router:Router) {}
  
  ngOnInit() {
    let data = dataCenter.customnote;
    if(dataCenter.customnote.length === 1) {
      localStorage.removeItem('customSavedFiles')
    }
    if(localStorage.getItem('customSavedFiles') === null) {
      localStorage.setItem('customSavedFiles', JSON.stringify([]));
    }
    let imagesData = JSON.parse(localStorage.getItem('customSavedFiles'));
    if(imagesData.length === 0) {
      let newImageData = {
        Id : dataCenter.customnote.length,
        filesUrl : 'data:application/pdf;base64,',
        imageUrl : "data:image/png;base64,"
      }
      imagesData.push(newImageData)
      localStorage.setItem("customSavedFiles", JSON.stringify(imagesData));
      imagesData = JSON.parse(localStorage.getItem('customSavedFiles'));
    }
    data.forEach((element:any,index) => {
      // assigning image and doc path as it is stored in different location
      element.imageUrl = imagesData[index].imageUrl;
      element.filesUrl = imagesData[index].filesUrl;
      this.customNoteData.push(element);
    });
    
  }
}